original_question:
$\textbf{Hen Dir Stampio Juan}$

Mae Juan yn trefnu'r stampiau yn ei gasgliad yn ôl gwlad ac yn ôl y degawd y cawsant eu cyhoeddi. Y prisiau a dalodd amdanynt mewn siop stampiau oedd: Brasil a Ffrainc, $6$ cent yr un, Periw $4$ cent yr un, a Sbaen $5$ cent yr un. (Mae Brasil a Pheriw yn wledydd De America ac mae Ffrainc a Sbaen yn Ewrop.) [asy]
/* AMC8 2002 #8, 9, 10 Problem */
size(3inch, 1.5inch);
for ( int y = 0; y <= 5; ++y )
{

draw((0,y)--(18,y));
}
draw((0,0)--(0,5));
draw((6,0)--(6,5));
draw((9,0)--(9,5));
draw((12,0)--(12,5));
draw((15,0)--(15,5));
draw((18,0)--(18,5));

label(scale(0.8)*"50au", (7.5,4.5));
label(scale(0.8)*"4", (7.5,3.5));
label(scale(0.8)*"8", (7.5,2.5));
label(scale(0.8)*"6", (7.5,1.5));
label(scale(0.8)*"3", (7.5,0.5));

label(scale(0.8)*"60au", (10.5,4.5));
label(scale(0.8)*"7", (10.5,3.5));
label(scale(0.8)*"4", (10.5,2.5));
label(scale(0.8)*"4", (10.5,1.5));
label(scale(0.8)*"9", (10.5,0.5));

label(scale(0.8)*"70au", (13.5,4.5));
label(scale(0.8)*"12", (13.5,3.5));
label(scale(0.8)*"12", (13.5,2.5));
label(scale(0.8)*"6", (13.5,1.5));
label(scale(0.8)*"13", (13.5,0.5));

label(scale(0.8)*"80au", (16.5,4.5));
label(scale(0.8)*"8", (16.5,3.5));
label(scale(0.8)*"15", (16.5,2.5));
label(scale(0.8)*"10", (16.5,1.5));
label(scale(0.8)*"9", (16.5,0.5));

label(scale(0.8)*"Gwlad", (3,4.5));
label(scale(0.8)*"Brasil", (3,3.5));
label(scale(0.8)*"Ffrainc", (3,2.5));
label(scale(0.8)*"Periw", (3,1.5));
label(scale(0.8)*"Sbaen", (3,0.5));

label(scale(0.9)*"Casgliad Stampiau Juan", (9,0), S);
label(scale(0.9)*"Nifer y Stampiau yn ôl Degawd", (9,5), N);
[/asy] Beth oedd y pris cyfartalog, mewn centiau, o'i stampiau $70\text{'s}$? Talgrynwch eich ateb i'r degfed ran agosaf o gant.

